import React from 'react';
import Cardlist from './Cardlist';
import Searchbox from './Searchbox';
import {robots} from './robots';




class App extends Componet {
    constructor() {
        super()
        this.state = {
            robots: robots,
            searchfield: ''

        }
    }
    render() {
        return(
            <div className='tc'>
                <h1> Robofriends </h1>
                <Searchbox/>
                <Cardlist robots ={robots}/>


            </div>
        );
    }       
}
export default App;
